(13, 0, '/mzfx54nfDPTUXZOG48u4LaEheDy.jpg', 55000000, 'https://www.paramountmovies.com/movies/forrest-gum', 'US', 'en', 'Forrest Gump', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.', '/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg', '1994-06-23', 677387716, 142, 'Released', 'Forrest Gump', 8.47, 27671, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(120, 0, '/z51Wzj94hvAIsWfknifKTqKJRwp.jpg', 93000000, 'http://www.lordoftherings.net/', 'US', 'en', 'The Lord of the Rings: The Fellowship of the Ring', 'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.', '/6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg', '2001-12-18', 871368364, 179, 'Released', 'The Lord of the Rings: The Fellowship of the Ring', 8.4, 25433, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(121, 0, '/6G73mNyooWAEQTpckPSnFxFoNmc.jpg', 79000000, 'http://www.lordoftherings.net/', 'US', 'en', 'The Lord of the Rings: The Two Towers', 'Frodo Baggins and the other members of the Fellowship continue on their sacred quest to destroy the One Ring--but on separate paths. Their destinies lie at two towers--Orthanc Tower in Isengard, where the corrupt wizard Saruman awaits, and Sauron\'s fortress at Barad-dur, deep within the dark lands of Mordor. Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman await', '/5VTN0pR8gcqV3EPUHHfMGnJYN9L.jpg', '2002-12-18', 926287400, 179, 'Released', 'The Lord of the Rings: The Two Towers', 8.4, 22074, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(122, 0, '/5JrZAtyk3LwiiAWLW0kwz41XZJC.jpg', 94000000, 'http://www.lordoftherings.net', 'US', 'en', 'The Lord of the Rings: The Return of the King', 'As armies mass for a final battle that will decide the fate of the world--and powerful, ancient forces of Light and Dark compete to determine the outcome--one member of the Fellowship of the Ring is revealed as the noble heir to the throne of the Kings of Men. Yet, the sole hope for triumph over evil lies with a brave hobbit, Frodo, who, accompanied by his loyal friend Sam and the hideous, wretched Gollum, ventures deep into the very dark heart of Mordor on his seemingly impossible quest to dest', '/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg', '2003-12-17', 1118888979, 201, 'Released', 'The Lord of the Rings: The Return of the King', 8.482, 24472, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(129, 0, '/6oaL4DP75yABrd5EbC4H2zq5ghc.jpg', 19000000, 'http://movies.disney.com/spirited-away', 'JP', 'ja', '千と千尋の神隠し', 'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.', '/39wmItIWsg5sZMyRUHLkWBcuVCM.jpg', '2001-07-20', 274925095, 125, 'Released', 'Spirited Away', 8.537, 16695, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(155, 0, '/x5f2uTfw0Pqc5QI4ch5AHICee2o.jpg', 185000000, 'https://www.warnerbros.com/movies/dark-knight/', 'US', 'en', 'The Dark Knight', 'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', '/qJ2tW6WMUDux911r6m7haRef0WH.jpg', '2008-07-16', 1004558444, 152, 'Released', 'The Dark Knight', 8.518, 33203, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(238, 0, '/tmU7GeKVybMWFButWEGl2M4GeiP.jpg', 6000000, 'http://www.thegodfather.com/', 'US', 'en', 'The Godfather', 'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.', '/3bhkrj58Vtu7enYsRolD1fZdja1.jpg', '1972-03-14', 245066411, 175, 'Released', 'The Godfather', 8.689, 20858, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
