(1064028, 0, '/co7oxvpWxgd6FZU24DnljDDHYQA.jpg', 4400000, '', 'US', 'en', 'Subservience', 'With his wife out sick, a struggling father brings home a lifelike AI, only to have his self-aware new help want everything her new family has to offer... Like the affection of her owner and she\'ll kill to get it.', '/gBenxR01Uy0Ev9RTIw6dVBPoyQU.jpg', '2024-08-15', 262793, 105, 'Released', 'Subservience', 6.762, 536, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1064213, 0, '/4cp40IyTpFfsT2IKpl0YlUkMBIR.jpg', 6000000, 'https://anora.film', 'US', 'en', 'Anora', 'A young sex worker from Brooklyn gets her chance at a Cinderella story when she meets and impulsively marries the son of an oligarch. Once the news reaches Russia, her fairytale is threatened as his parents set out to get the marriage annulled.', '/7MrgIUeq0DD2iF7GR6wqJfYZNeC.jpg', '2024-10-14', 32402606, 139, 'Released', 'Anora', 6.9, 703, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1079244, 0, '/r5mue22IsLWI8OMHqq5TCko6J72.jpg', 25000000, 'https://www.angel.com/movies/bonhoeffer', 'BE', 'en', 'Bonhoeffer: Pastor. Spy. Assassin', 'As the world teeters on the brink of annihilation, Dietrich Bonhoeffer joins a deadly plot to assassinate Hitler, risking his faith and fate to save millions of Jews from genocide.', '/7sQUousjbOVlVj3rKuXYly19sjf.jpg', '2024-11-20', 12165702, 132, 'Released', 'Bonhoeffer: Pastor. Spy. Assassin', 7, 20, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1084736, 0, '/llIXQAndg5kB6SWlp6ouUdO7Zxd.jpg', 46000000, 'https://www.countofmontecristofilm.co.uk', 'FR', 'fr', 'Le Comte de Monte-Cristo', 'Edmond Dantes becomes the target of a sinister plot and is arrested on his wedding day for a crime he did not commit. After 14 years in the island prison of Château d’If, he manages a daring escape. Now rich beyond his dreams, he assumes the identity of the Count of Monte-Cristo and exacts his revenge on the three men who betrayed him.', '/zw4kV7npGtaqvUxvJE9IdqdFsNc.jpg', '2024-06-28', 75360860, 178, 'Released', 'The Count of Monte Cristo', 8.1, 1244, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1094274, 0, '/47bsGWAEtJNWMcd3oNS7TELmi6v.jpg', 15000000, 'https://a24films.com/films/y2k', 'US', 'en', 'Y2K', 'Two high school nobodies make the decision to crash the last major celebration before the new millennium on New Year\'s Eve 1999. The night becomes even crazier than they could have ever dreamed when the clock strikes midnight.', '/qndubIQalyxBJI5EBNZKGXEX74q.jpg', '2024-12-06', 4210306, 91, 'Released', 'Y2K', 5.314, 97, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1097549, 0, '/hctfNoMpQGfn3VXdBYb9p0P5bT5.jpg', 20000000, 'https://a24films.com/films/babygirl', 'US', 'en', 'Babygirl', 'A high-powered CEO puts her career and family on the line when she begins a torrid affair with her much younger intern.', '/A8HbTd0FemZyFCh5qvJFpHGiwF8.jpg', '2024-12-25', 22359690, 115, 'Released', 'Babygirl', 5.6, 56, '2025-01-13 18:17:29', '2025-01-13 18:17:29');
INSERT INTO `movies` (`movie_id`, `adult`, `backdrop_path`, `budget`, `homepage`, `origin_country`, `original_language`, `original_title`, `overview`, `poster_path`, `release_date`, `revenue`, `runtime`, `status`, `title`, `vote_average`, `vote_count`, `created_at`, `updated_at`) VALUES
(1100099, 0, '/zpaodBqO2lcwJh2SQrFFf1Rn8Jy.jpg', 20000000, 'https://a24films.com/films/we-live-in-time', 'GB', 'en', 'We Live in Time', 'An up-and-coming chef and a recent divorcée find their lives forever changed when a chance encounter brings them together, in a decade-spanning, deeply moving romance.', '/ssFS25CiYQvRJqErqaEyHuVgyH7.jpg', '2024-10-10', 37182814, 108, 'Released', 'We Live in Time', 7.524, 442, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1100782, 0, '/iR79ciqhtaZ9BE7YFA1HpCHQgX4.jpg', 28000000, 'https://www.smile.movie', 'US', 'en', 'Smile 2', 'About to embark on a new world tour, global pop sensation Skye Riley begins experiencing increasingly terrifying and inexplicable events. Overwhelmed by the escalating horrors and the pressures of fame, Skye is forced to face her dark past to regain control of her life before it spirals out of control.', '/ht8Uv9QPv9y7K0RvUyJIaXOZTfd.jpg', '2024-10-16', 138083280, 127, 'Released', 'Smile 2', 6.607, 1145, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1106739, 0, '/9Qq8InnodUYs8zdam8Zj967i6RO.jpg', 30000000, 'https://afdah-movies.info/', 'US', 'en', 'Juror #2', 'While serving as a juror in a high profile murder trial, family man Justin Kemp finds himself struggling with a serious moral dilemma…one he could use to sway the jury verdict and potentially convict—or free—the accused killer.', '/utLESWj433xnIc1ss9TZjRI9SSl.jpg', '2024-10-30', 21418477, 114, 'Released', 'Juror #2', 7, 1136, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1118031, 0, '/lTYGtgDRygku7iiFLWyiEc4wLzz.jpg', 0, 'https://nostromopictures.com/en/movies/coming-soon', 'ES', 'es', 'Apocalipsis Z: el principio del fin', 'When a kind of rabies that transforms people into aggressive creatures spreads across the planet, Manel isolates himself at home with his cat, relying on his wits to survive; but soon they must go out in search of food, by land and by sea, dodging many dangers.', '/wIGJnIFQlESkC2rLpfA8EDHqk4g.jpg', '2024-10-04', 500000, 119, 'Released', 'Apocalypse Z: The Beginning of the End', 6.837, 834, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1128650, 0, '/mMmmAADAYrLozZk8GXqZt8dAmem.jpg', 0, '', 'CN', 'cn', '誤判', 'A poor young man is wrongly charged with drug trafficking after being deceived. An ex-prosecutor investigates the case, uncovers a corrupt lawyer team\'s scheme.', '/q8Wmy23507g5QI3J0kiMof3wlcb.jpg', '2024-12-08', 24650452, 117, 'Released', 'The Prosecutor', 7.9, 7, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1138194, 0, '/ag66gJCiZ06q1GSJuQlhGLi3Udx.jpg', 10000000, 'https://a24films.com/films/heretic', 'US', 'en', 'Heretic', 'Two young missionaries are forced to prove their faith when they knock on the wrong door and are greeted by a diabolical Mr. Reed, becoming ensnared in his deadly game of cat-and-mouse.', '/5HJqjCTcaE1TFwnNh3Dn21be2es.jpg', '2024-10-31', 51913394, 111, 'Released', 'Heretic', 7.197, 822, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1147416, 0, '/rZmijM6poWf1nNItkZZ8H3gMkX7.jpg', 0, '', 'FR', 'fr', 'Miraculous World : Londres, la course contre le temps', 'To save the future from a terrible fate, Marinette becomes Chronobug and teams up with Bunnyx to defeat a mysterious opponent who travels through time. Who is this new supervillain, and why are they obsessed with exposing Marinette\'s secret superhero identity? Marinette\'s only hope is to defeat her new opponent to prevent the end of Ladybug and time itself!', '/6AtoMpHvs9pxd30KsyK8QmJ9W9M.jpg', '2024-11-14', 0, 50, 'Released', 'Miraculous World, London: At the Edge of Time', 7.8, 112, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1154304, 0, '/y6uJ11Q1O7k5cJlVuqUBkrQEdUn.jpg', 0, 'https://www.warnerbros.co.uk/movies/buffalo-kids', 'ES', 'es', 'Buffalo Kids', 'Mary and Tom are parentless Irish siblings who arrive in New York City via ocean liner in 1886 and quickly find themselves on a wild, cross-country journey aboard a transcontinental \"Orphan Train\" where they meet an extraordinary new friend who will change their lives forever.', '/nRWiUth8Cr5bG9AQkDZHoAS25CW.jpg', '2024-08-14', 7478666, 83, 'Released', 'Buffalo Kids', 6.8, 18, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1156593, 0, '/k24eZq5I3jyz4htPkZCRpnUmBzE.jpg', 0, 'https://www.amazon.com/dp/B0DJ1L7ZN3', 'ES', 'es', 'Culpa tuya', 'The love between Noah and Nick seems unwavering despite their parents\' attempts to separate them. But his job and her entry into college open up their lives to new relationships that will shake the foundations of both their relationship and the Leister family itself.', '/1sQA7lfcF9yUyoLYC0e6Zo3jmxE.jpg', '2024-12-26', 0, 120, 'Released', 'Your Fault', 7.1, 830, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1167271, 0, '/fyeyxFzZ3qYqDsaMVYF6sq3pp2n.jpg', 30000000, '', 'US', 'en', 'Weekend in Taipei', 'A former DEA agent and a former undercover operative revisit their romance during a fateful weekend in Taipei, unaware of the dangerous consequences of their past.', '/qSc0AUvs8mRy00R9y8QYEHWIAQ9.jpg', '2024-09-19', 2826064, 101, 'Released', 'Weekend in Taipei', 6.2, 112, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1182387, 0, '/evFChfYeD2LqobEJf8iQsrYcGTw.jpg', 11500000, '', 'US', 'en', 'Armor', 'Armored truck security guard James Brody is working with his son Casey transporting millions of dollars between banks when a team of thieves led by Rook orchestrate a takeover of their truck to seize the riches. Following a violent car chase, Rook soon has the armored truck surrounded and James and Casey find themselves cornered onto a decrepit bridge.', '/pnXLFioDeftqjlCVlRmXvIdMsdP.jpg', '2024-10-30', 0, 89, 'Released', 'Armor', 5.511, 133, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1184918, 0, '/1pmXyN3sKeYoUhu5VBZiDU4BX21.jpg', 78000000, 'https://www.thewildrobotmovie.com', 'US', 'en', 'The Wild Robot', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', '/9w0Vh9eizfBXrcomiaFWTIPdboo.jpg', '2024-09-12', 324352935, 102, 'Released', 'The Wild Robot', 8.365, 3923, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1196470, 0, '/csQSGH0QU8D3Ov5YLEYuHep8ihA.jpg', 5270000, 'https://amzn.to/3ZPDLly', 'FR', 'fr', 'Survivre', 'A couple celebrates their son’s birthday in the middle of the ocean on their boat. A violent storm hits and it brings up hungry creatures from the depths and they fight for their survival.', '/59nsfU5hMG3puDZIGzZzJ1yW8FN.jpg', '2024-06-19', 0, 90, 'Released', 'Survive', 5.9, 100, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1214667, 0, '/i9bhxhUBFZHorvK81GNKMJGj2Kt.jpg', 0, 'https://www.netflix.com/title/81734609', 'GB', 'en', 'Making Squid Game: The Challenge', 'Go behind the scenes and witness how the \"Squid Game\"-inspired reality show transformed from a scripted drama to a cutthroat, nail-biting competition.', '/78yTLvtsMntVN1cLfzBuZj870pe.jpg', '2023-12-06', 0, 30, 'Released', 'Making Squid Game: The Challenge', 6.4, 29, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1216191, 0, '/6GhU4BJnqLSaAuz0yQBq3RfdzsF.jpg', 0, '', 'IE', 'en', 'Oddity', 'After the brutal murder of her twin sister, Darcy goes after those responsible by using haunted items as her tools for revenge.', '/3Z9c1tbUhP0QruRjczPHnbx3U2D.jpg', '2024-07-19', 1699044, 98, 'Released', 'Oddity', 6.806, 333, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1232449, 0, '/A7KwHKB5faRRRRveVQC5TPI35kV.jpg', 0, 'https://www.polar-bear.tv/young-hearts', 'BE', 'nl', 'Young Hearts', 'Fourteen-year-old Elias increasingly feels like an outsider in his village. When he meets his new neighbour of the same age, Alexander, Elias is confronted with his burgeoning sexuality.', '/iGCtYxfuvXfy0BD5m6p7vKuPOxS.jpg', '2024-10-26', 0, 100, 'Released', 'Young Hearts', 8.2, 32, '2025-01-13 18:17:30', '2025-01-13 18:17:30'),
(1235623, 0, '/bx6LoGl8L3hwgOCoD2H8JgIu7uC.jpg', 0, '', 'CN', 'zh', '目中无人 2', 'The blind swordsman, skilled in martial arts, named Cheng Xiazi (Xie Miao), accidentally saves Zhang Xiaoyu (Yang Enyou), who has suffered from the destruction of his family. Under the persuasion of the orphan Xiaoyu, Cheng reluctantly keeps him by his side and teaches him skills. Xiaoyu also waits for the opportunity to seek revenge.', '/lxGkinl8TwFdIUffEdTOw95lKL7.jpg', '2024-07-21', 0, 90, 'Released', 'Eye for an Eye 2', 8, 3, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1241982, 0, '/vYqt6kb4lcF8wwqsMMaULkP9OEn.jpg', 150000000, 'https://movies.disney.com/moana-2', 'US', 'en', 'Moana 2', 'After receiving an unexpected call from her wayfinding ancestors, Moana journeys alongside Maui and a new crew to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she\'s ever faced.', '/aLVkiINlIeCkcZIzb7XHzPYgO6L.jpg', '2024-11-21', 989755208, 100, 'Released', 'Moana 2', 7.001, 830, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1252309, 0, NULL, 0, '', 'ES', 'es', 'Pídeme lo que quieras', 'After his father\'s death, Eric Zimmerman travels to Spain to oversee his company\'s branches. In Madrid, he falls for Judith and engage in an intense, erotic relationship full of exploration. However, Eric fears his secret may end their affair.', '/76qnVxU2rPdVvipBN3DPQH6fVYB.jpg', '2024-11-29', 0, 0, 'Released', 'Ask Me What You Want', 6.2, 39, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1276945, 0, '/A28EE0vgHrB0OdoxWWMfgfyEoYn.jpg', 0, 'https://www.netflix.com/title/81674409', 'BE', 'nl', 'Ferry 2', 'After losing his drug empire, Ferry Bouman has found a measure of peace away from Brabant\'s criminal underworld — until his past catches up to him.', '/8pwdnL3pEISIN1EGmwZzU6hpNVk.jpg', '2024-12-19', 0, 94, 'Released', 'Ferry 2', 5.6, 85, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1357633, 0, '/kylozAI9Rf1pp7pZ8nFPK4s1s5n.jpg', 0, 'https://www.sololevelingreawakening.com', 'JP', 'ja', '俺だけレベルアップな件 -ReAwakening-', 'Over a decade after \'gates\' connecting worlds appeared, awakening \'hunters\' with superpowers, weakest hunter Sung Jinwoo encounters a double dungeon and accepts a mysterious quest, becoming the only one able to level up, changing his fate. A catch-up recap of the first season coupled with an exclusive sneak peek of the first two episodes of the highly anticipated second season in one momentous theatrical fan experience.', '/uzHMp5heVLR68kbbUEXFPsmxYsM.jpg', '2024-11-26', 4150341, 116, 'Released', 'Solo Leveling -ReAwakening-', 7, 71, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1397347, 0, '/s1zRSPvWilCeu5cP0SWX6ZCdK2q.jpg', 0, 'https://www.wwe.com/shows/snme/2024', 'US', 'en', 'Saturday Night\'s Main Event XXXVII', 'Undisputed WWE Champion Cody Rhodes will go head-to-head with Kevin Owens as Saturday Night\'s Main Event returns to NBC. Plus World Tag Team Champion Finn Bálor will face \"The Ring General\" Gunther for the World Heavyweight Title. The Women\'s World Championship will be on the line when Liv Morgan defends her title against IYO SKY.', '/cS90gS08N2I4LW0dh5omKh2ywiw.jpg', '2024-12-14', 0, 82, 'Released', 'Saturday Night\'s Main Event XXXVII', 7.3, 5, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1397854, 0, '/rFKbPDXBzgn4eYBdJXaAPEYIcyA.jpg', 0, 'https://www.netflix.com/title/81630894', 'IT', 'it', 'Mica è Colpa Mia', 'Drowning in debt, two brothers concoct a plan to scam a wealthy heiress and save their home in Naples — but unexpected love soon complicates the scheme.', '/kWBjdB6tP71ed4WTFxuqDZnWVk5.jpg', '2025-01-01', 0, 101, 'Released', 'The Love Scam', 6.6, 60, '2025-01-13 18:17:29', '2025-01-13 18:17:29'),
(1401905, 0, '/ey6HaUwo4CJoOYDlJ0M90ykJ0dt.jpg', 0, 'https://www.netflix.com/title/81757532', 'US', 'en', 'Don\'t Die: The Man Who Wants to Live Forever', 'In this documentary, wealthy entrepreneur Bryan Johnson puts his body and fortune on the line to defy aging and extend his life beyond all known limits.', '/7VqUPN0oRHfYV9hdZcal1ZzffmV.jpg', '2025-01-01', 0, 88, 'Released', 'Don\'t Die: The Man Who Wants to Live Forever', 5.909, 22, '2025-01-13 18:17:29', '2025-01-13 18:17:29');
