INSERT INTO `tv_seasons` (`tv_season_id`, `tv_series_id`, `air_date`, `name`, `overview`, `poster_path`, `season_number`, `vote_average`, `created_at`, `updated_at`) VALUES
(298, 100, '2004-05-10 00:00:00', 'Season 1', '', NULL, 1, 2.6, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(299, 100, NULL, 'Specials', '', NULL, 0, 0, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(785, 246, '2005-02-21 00:00:00', 'Book One: Water', 'Katara and Sokka (a brother and sister from the Southern Water Tribe) discover the Avatar (a 12-year-old Airbender boy named Aang) frozen in an iceberg. Together the three begin their journey to the North Pole to find a master waterbender so Aang can begin his Avatar training!', '/tUG6h0rMtQyOgvqI8r9AqxlKoUP.jpg', 1, 7.9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(786, 246, '2007-09-21 00:00:00', 'Book Three: Fire', 'Aang wakes up from his battle with Azula to discover that Ba Sing Se has fallen and the world thinks he\'s dead. So he and his friends set off undercover across the Fire Nation to find Fire Lord Ozai before the Day of Black Sun. Prince Zuko returns home as the triumphant son, but soon finds the honor he so greatly craved from his father is worthless. New alliances are formed and Team Avatar forges a new plan to stop the Fire Lord. But will they find him in time?', '/roPE4jaHawj1Dm6uIXJHuLDpkNy.jpg', 3, 8.2, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(787, 246, '2006-03-17 00:00:00', 'Book Two: Earth', 'Aang, along with Katara, Sokka, and their animal friends Appa and Momo, continues on his quest to fulfill his destiny as the Avatar. According to the Avatar cycle, the group must now enter the Earth Kingdom to search for a master earthbender to teach Aang.', '/quX70K1L7vTLQ9vRJcK0kKcNNFA.jpg', 2, 8.1, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
