(2640, 911, '2005-08-05 00:00:00', 'Season 2', 'On 5 August 2005, the show was restarted after a four-year hiatus, and renamed Kaun Banega Crorepati Dwitiya or KBC 2. During this season, the top prize amount was doubled to 2 Crore (twenty million) Rupees. It was abruptly ended by STAR Plus after Amitabh Bachchan fell ill in 2006 after he shot his last episode on 13 January 2006.', NULL, 2, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(2641, 911, '2007-01-22 00:00:00', 'Season 3', 'Star Television recruited Shah Rukh Khan to host the third season of the show when Bachchan declined. The grand prize remained 2 Crore (twenty million) Rupees. The third season of the show began airing on 22 January 2007 with the first contestant as Prasenjit Sarkar who was the last contestant dropped from season two midway owing to Bachchan\'s health. The show started well but the show\'s ratings dropped significantly due to the change of the host. The season ended on 19 April 2007 with a special', NULL, 3, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(2642, 911, '2000-07-03 00:00:00', 'Season 1', 'KBC premiered on 3 July 2000 and was hosted by Amitabh Bachchan, his first appearance on Indian television. KBC initially offered contestants the chance to win 1 Crore (ten million) Indian rupees. The declining ratings of KBC paved way for reformatting the series immediately as Junior KBC with kids as contestants which started airing from 6 May 2001. The season ended on 31 December 2001. The show was well received in its premiere season.', NULL, 1, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3572, 1396, '2008-01-20 00:00:00', 'Season 1', 'High school chemistry teacher Walter White\'s life is suddenly transformed by a dire medical diagnosis. Street-savvy former student Jesse Pinkman \"teaches\" Walter a new trade.', '/1BP4xYv9ZG4ZVHkL7ocOziBbSYH.jpg', 1, 8.3, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3573, 1396, '2009-03-08 00:00:00', 'Season 2', 'Walt must deal with the chain reaction of his choice, as he and Jesse face new and severe consequences. When danger and suspicion around Walt escalate, he is pushed to new levels of desperation. Just how much higher will the stakes rise? How far is Walt willing to go to ensure his family\'s security? Will his grand plan spiral out of control?', '/e3oGYpoTUhOFK0BJfloru5ZmGV.jpg', 2, 8.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3575, 1396, '2010-03-21 00:00:00', 'Season 3', 'Walt continues to battle dueling identities: a desperate husband and father trying to provide for his family, and a newly appointed key player in the Albuquerque drug trade. As the danger around him escalates, Walt is now entrenched in the complex worlds of an angst-ridden family on the verge of dissolution, and the ruthless and unrelenting drug cartel.', '/ffP8Q8ew048YofHRnFVM18B2fPG.jpg', 3, 8.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3576, 1396, '2011-07-17 00:00:00', 'Season 4', 'Walt and Jesse must cope with the fallout of their previous actions, both personally and professionally. Tension mounts as Walt faces a true standoff with his employer, Gus, with neither side willing or able to back down. Walt must also adjust to a new relationship with Skyler, whom while still reconciling her relationship with Walt, is committed to properly laundering Walt’s money and ensuring her sister Marie and an ailing Hank are financially stable.', '/5ewrnKp4TboU4hTLT5cWO350mHj.jpg', 4, 8.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3577, 1396, '2009-02-17 00:00:00', 'Specials', '', '/40dT79mDEZwXkQiZNBgSaydQFDP.jpg', 0, 0, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3578, 1396, '2012-07-15 00:00:00', 'Season 5', 'Walt is faced with the prospect of moving on in a world without his enemy. As the pressure of a criminal life starts to build, Skyler struggles to keep Walt’s terrible secrets. Facing resistance from sometime adversary and former Fring lieutenant Mike, Walt tries to keep his world from falling apart even as his DEA Agent brother in law, Hank, finds numerous leads that could blaze a path straight to Walt. ', '/r3z70vunihrAkjILQKWHX0G2xzO.jpg', 5, 8.9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3617, 1398, '1999-01-10 00:00:00', 'Season 1', 'In Season 1, feeling his handle on his family and his business slipping away, mob boss Tony Soprano suffers a series of anxiety attacks that land him in the office of a psychiatrist. Opening up to his shrink, Tony relates the details of his life as a “waste-management consultant,” and tries to come to terms with the professional and private strains that have brought him to the brink of a breakdown.', '/3NsJzafk0Sp7yE9yShzQsybHw4x.jpg', 1, 7.8, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3618, 1398, '2000-01-16 00:00:00', 'Season 2', 'His uncle\'s in jail. His mother\'s in the hospital. His best friend\'s still missing. His sister\'s moving home. His panic attacks are back. And his shrink refuses to see him. Tony Soprano has recently been elevated to the status of mob boss following a federal bust and as the second season picks up, Tony is under more stress than ever as he deals with the demands of his new position. Making matters worse, his long-lost sister Janice has arrived to take care of their ailing mother.', '/wvCOKWM1abB5CfuWKqDYeMRV3lN.jpg', 2, 7.9, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3619, 1398, '2001-03-04 00:00:00', 'Season 3', 'In season three, the federal wiretap begins and Meadow goes to college. Tony faces challenges from some tough newcomers, such as hothead Ralph Cifaretto, New York crime boss Johnny Sack and a sexy car saleswoman.', '/zFuz2PgkHDr9Lx5YAEmiWbXKCio.jpg', 3, 8, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3620, 1398, '2002-09-15 00:00:00', 'Season 4', 'With Paulie in jail, Christopher becomes acting capo in season four. Junior faces a RICO trial while Tony finds that the recession affects his businesses. Meanwhile, Furio catches Carmela\'s eye, and Janice sets her sights on Bobby.', '/q01fVFY7rQEMMnexa9Urv7NOdKO.jpg', 4, 7.9, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3621, 1398, '2004-03-07 00:00:00', 'Season 5', 'In season five, a separated Tony and Carmela negotiate family and money issues. Meanwhile, Tony\'s reunion with paroled cousin Tony Blundetto may endanger his alliance with Johnny Sack; and Adriana gets in deeper with the Feds.', '/p651eYM0Vd0CWDvndbMyaS0lDeD.jpg', 5, 8.2, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3622, 1398, '2006-03-12 00:00:00', 'Season 6', 'As the final episodes take shape, Tony faces a myriad of stress-inducing crises at home, at work, and from the law. While his wife and children each make choices that promise to change the face of the Sopranos\' domestic life, Tony also comes to doubt the allegiances of some of those closest to him at work . . . none of whom is above suspicion.', '/b1P9PAUI18mb62N0DtHOd71L3CT.jpg', 6, 8.2, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3623, 1398, '2009-08-03 00:00:00', 'Specials', '', '/ssb4CywjfM95MR71pTTIfAq2BlM.jpg', 0, 0, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(3674, 1408, '2004-11-16 00:00:00', 'Season 1', 'Dr. Gregory House is devoid of bedside manner  and wouldn\'t even talk to his patients if he could get away with it.  Dealing with his own constant physical pain, he uses a cane that seems  to punctuate his acerbic, brutally honest demeanor. While his behavior  can border on antisocial, House is a maverick physician whose  unconventional thinking and flawless instincts have afforded him a great  deal of respect. House\'s roster of medical cases are the inexplicable  ones other doctors can\'t solve,', '/lXBIhFheyDRA72vRQvYF1mkEF27.jpg', 1, 7.7, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3675, 1408, '2005-09-13 00:00:00', 'Season 2', 'House will do whatever it takes to solve a  case before it\'s too late, from sending one of his team to break into a  patient\'s home in search of clues, to attempting a controversial,  trial-and-error form of treatment to see how a patient responds. House\'s  methods may be suspect, but his results are not — he saves lives no one  else can. Always in House\'s way is Dr. Lisa Cuddy, the Dean of Medicine  and hospital administrator — and ethical gatekeeper of the hospital who  is in constant conflict', '/j2LxTsMhXYqfi4k9Vome8kQc26U.jpg', 2, 7.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3676, 1408, '2008-09-16 00:00:00', 'Season 5', 'In the Season 4 finale, after a massive bus accident left House without  recollection of the accident, he and  the team put the pieces of his  memory together and discover Wilson’s girlfriend Amber was on the bus  with him and was fatally injured.  Wilson has to face the shocking  realization that House was involved in Amber’s death.\n\nAs Season 5  opens, with his friendship with Wilson shattered, House must determine  if he’s responsible for Amber’s death and Wilson must decide if House is  a de', '/bwE3QGVeC7E5VycnIPVzPtzpBId.jpg', 5, 7.7, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3677, 1408, '2009-09-21 00:00:00', 'Season 6', 'When the previous season concluded, House was  forced to admit that he had lost his grip on reality and could no longer  practice medicine.  Out of options, he checked himself into a  psychiatric hospital. Season 6 will explore  House’s long and twisted road to recovery: Can he find some version of  sanity and normalcy? Can he stay away from the workplace that arguably  drove him to mental instability but is also the only stable foundation  in his life? Can Princeton-Plainsboro continue its cele', '/hhcJGHhq2xMUCp2sGRrw523M7Zx.jpg', 6, 7.8, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3678, 1408, '2007-09-25 00:00:00', 'Season 4', 'In the Season 3 finale, the set-in-his-ways House was confronted  with a series of major changes to his team — but any effects of this  “house-cleaning,\" or the changes it may bring to House professionally or  personally, remain to be seen...', '/CryJFbwif5U1VViZ5EkmeomD3q.jpg', 4, 7.9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3679, 1408, '2006-09-05 00:00:00', 'Season 3', 'In the Season 2 finale, House suffered  multiple gunshot wounds inflicted by a former patient\'s husband  determined to carry out retribution for House\'s treatment of his wife\'s  case. In a shocking surprise to his co-workers, House comes through the  ordeal with a slightly new perspective on his treatment of patients —  but will it affect how he makes medical decisions? And will it last?', '/muuLevUfVbpq87lWljfZ8HLga6b.jpg', 3, 7.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3680, 1408, '2010-09-20 00:00:00', 'Season 7', 'In the Season 6 finale, House, driven by the  loss of a patient he treated at an accident site and confronted with  the unexpected news that Cuddy was now engaged, spiraled into despair  and considered treating his mental and emotional anguish with Vicodin,  potentially prompting the cycle of his dependency and addiction all over  again. But in a surprising turn, Cuddy revealed that she called off her  engagement and admitted to House she loves him, despite wishing she  didn’t. Also, Thirteen su', '/x62Ii2v8fZer0jhpT4w9ngdUE4j.jpg', 7, 7.9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3681, 1408, '2011-10-03 00:00:00', 'Season 8', 'Last season, House and Cuddy finally decided to take  their relationship to the next level, but struggled to find a balance  between their professional and personal lives, and ultimately, Cuddy  made the very emotional decision to end their relationship. As each of  them dealt with the aftermath of the break-up, House got married to an  immigrant in need of a Green Card. In the series\' milestone 150th  episode, Thirteen was released from prison after euthanizing her brother  who was suffering fr', '/fqMpdjiGe4jejxTm1NAWnhRV6CM.jpg', 8, 7.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3682, 1408, '2011-02-10 00:00:00', 'Specials', '', '/4qDffrHMZRjSqiR3mVmzvAkhh54.jpg', 0, 0, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3788, 1429, '2013-04-07 00:00:00', 'S1 • \'Fall of Shiganshina\' & the \'Battle of Trost District\'', 'Centuries ago, mankind was slaughtered to near extinction by monstrous humanoid creatures called titans, forcing humans to hide in fear behind enormous concentric walls. What makes these giants truly terrifying is that their taste for human flesh is not born out of hunger but what appears to be out of pleasure. To ensure their survival, the remnants of humanity began living within defensive barriers, resulting in one hundred years without a single titan encounter. However, that fragile calm is s', '/AgaD7s1vgIf4Soi3flAKN6Bte6u.jpg', 1, 8.3, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3789, 1429, '2013-07-07 00:00:00', 'Specials', 'The complete selection of specials relating to any \'Attack on Titan\' TV series, including spin-offs and \'The Final Chapters\' specials that aired.', '/no3dkH44ywREi0la8tw4TnA1GxN.jpg', 0, 0, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(3811, 1433, '2005-02-06 00:00:00', 'Season 1', 'From the delightfully twisted creative minds behind \'Family Guy\' comes \'American Dad\', the animated tour de force featuring CIA operative Stan Smith, his outrageous family and Roger, the alcoholic extraterrestrial who lives with them! Follow the adventures of the Smiths from the California desert, where Stan\'s wife, Francine, relives her teenage years at the Burning Man festival, to Saudi Arabia, where the entire family is sentenced to death by the Vice and Virtue Police! Whether it\'s rigging el', '/8bSEmNdnEBOCdKzCs3FKcSguUz.jpg', 1, 6.5, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3812, 1433, '2006-09-10 00:00:00', 'Season 3', 'C.I.A. weapons expert Stan Smith is back, keeping the homeland secure while alienating his family and terrorising his neighbours in the process. Whether he\'s saddling up for a mad cow cattle drive or destroying evidence of President Bush\'s drunken debauchery, Stan does whatever it takes to ensure domestic tranquility and make the world safe for democracy of the ultra-right-wing variety! Join the Smith family and Roger, their alcoholic pet alien, for this hilarious Volume Three of \'American Dad!\'', '/7mzhkPfCwo5yToU5ZSbQhoBf1db.jpg', 3, 6.7, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3813, 1433, '2007-09-30 00:00:00', 'Season 4', 'Attention, terrorists, pinkos, and hippies: your days are numbered! CIA Agent Stan Smith is back, stopping at nothing to make the world safe for right-wing democracy and provide for his outrageously dysfunctional extended family. Amid botched kidnappings and beefcake body doubles, Stan hosts a torturously funny CIA telethon; his wife, Francine, is reunited with her ex-fiance; and resident-alien Roger hosts a booze-soaked spring break that may just push favorite son Steve all the way through pube', '/64MpZFTfXT2KQ9DeojeqXQyry0Y.jpg', 4, 6.5, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3814, 1433, '2008-09-28 00:00:00', 'Season 5', 'The hilarious, over-the-top adventures of CIA Agent Stan Smith - a red-white-and-blue-blooded, one-man war on terror - and his delightfully dysfunctional family. Volume Five celebrates that great American pastime - revenge! Steve and his friends strike back at Bar Mitzvah boy - Etan Cohen for stealing Steve\'s girlfriend, Francine puts Stan through the ringer when she finds out he\'s picked a back-up wife, and Roger unleashes deadly hotdog havoc throughout Langley Falls - all in the name of good o', '/3sSvLyUBSM4nxNFNUT8Y2C4lNMA.jpg', 5, 7.1, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3815, 1433, '2010-10-03 00:00:00', 'Season 7', 'It\'s a time once again to let it all hang out with an all-new volume of animated outrageousness! From the disturbed comic minds of Mike Barker, Matt Weitzman, and Family Guy creator Seth MacFarlane, comes the always insane adventures of CIA operative Stan Smith and his wonderfully twisted family. In the 100th episode, Hayley elopes with Jeff! Other episodes include Stan on jury duty, Steve walking in on his amorous parents, Roger dating Steve\'s best friend, and yet another American Dad Christmas', '/zPn0NxOvsFDIoAK4CjKPfleJFEC.jpg', 7, 7.1, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3816, 1433, NULL, 'Specials', '', '/7PkXhP5zoMSApTkyeg8Qkg3IEgu.jpg', 0, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3817, 1433, '2011-09-25 00:00:00', 'Season 8', 'Let your American freak flag fly when you watch this all-new collection of outrageous episodes from the comic minds of Mike Barker, Matt Weitzman and Family Guy creator Seth MacFarlane. Follow the adventures of CIA operative Stan Smith\'s quirky family as they deal with Stan and Francine\'s killer hot tub, Steve\'s lucky panties, Hayley and Jeff adopting an evil child, and Roger wrestling his way into the record books. Loaded with celebrity guest voices, including Sarah Michelle Gellar, CeeLo Green', '/gCXgZki3eATomtrzK74MQHVnYfI.jpg', 8, 7.2, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3818, 1433, '2012-09-30 00:00:00', 'Season 9', 'Take a “Stan\" against boring, bipartisan comedy with this all-new collection of hilariousuncensored American Dadl episodes from the infinitely creative minds of Mike Barker, Matt Weitzman and Family Guy creator Seth MacFarlane. This outrageous assortment finds Stan and Klaus switching bodies, Steve joining a boy band, Jeff being held prisoner in space, and Roger falling hard for his latest crush...Hayley!', '/5ujRpXwzVwEiWCr4DygUB1xg0Z6.jpg', 9, 7.1, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3819, 1433, '2013-09-29 00:00:00', 'Season 10', 'Belly-laugh up to the bar, folks… and satisfy your thirst for hilarity with the all-new collection of uncensored American Dad! episodes from the spirited minds of Mike Barker, Matt Weitzman and Family Guy creator Seth MacFarlane. Loaded with celebrity guest voices, including Mariah Carey, Terry Crews, Mark Cuban, Zooey Deschanel, Danny Glover and Olivia Wilde, this intoxicating assortment finds Stan fired from the CIA, Francine haunted by a sex-starved ghost, Steve kidnapped by a Christmas demon', '/qjdqKOZdhTHLAjcFjaOwtbv3OKP.jpg', 10, 6.5, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(3820, 1433, '2005-09-11 00:00:00', 'Season 2', 'Terrorists (and all you bed-wetting hippie-liberal types) beware! Ultra-right-wing C.I.A. agent Stan Smith is back, taking names, and, well, you know the rest. Join Stan, along with his hilariously off-beat family, as he spans the globe to make the world safe for democracy! If you are ready to support your country, and if you\'re ready for a widly outrageous animated farce from Mike Barker, Matt Weitzman and Seth MacFarlane, the creative mastermind behind Family Guy, you\'re ready for American Dad', '/ujW8p4k4gAbka9ZuXQFQLZjBEbg.jpg', 2, 6.8, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
