(43387, 31911, '2009-08-25 00:00:00', 'Specials', 'The specials consist of five episodes that expand on moments and characters from the main series. These short episodes offer a mix of humor, emotional depth, and additional backstory, enriching the overall narrative. In \"The Blind Alchemist,\" Edward and Alphonse investigate a man who claims to have performed human transmutation, only to uncover a tragic secret. \"Simple People\" is a lighthearted episode featuring Winry and Riza Hawkeye, where Winry strives to improve her automail skills. \"The Tal', '/iQZNlUAUHUGcf9diIePkzkVcCOz.jpg', 0, 0, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(43388, 31911, '2009-04-04 00:00:00', 'Season 1', 'Brothers Edward and Alphonse Elric suffer a tragic loss after attempting forbidden alchemy to bring back their deceased mother. Edward loses a leg and an arm, while Alphonse\'s body is entirely taken. To save his brother, Edward binds Alphonse\'s soul to a suit of armor. Now, the brothers seek the Philosopher’s Stone to restore their bodies.\n\nEdward becomes a State Alchemist, and they face threats from Scar, a vengeful warrior, and the Homunculi, mysterious enemies linked to the Philosopher\'s Ston', '/fu32TnQCWdbyJDRTO40NXOcwJKo.jpg', 1, 7.1, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(44425, 33238, '2010-07-11 00:00:00', 'Season 1', 'Unpredictable big laugh that no one ever imagined!! \n\nHow many landmarks do you know representing Korea? \n\nKorea\'s representative landmark that Running Man teaches with his body! \n\n Korea\'s top celebrities gathered there! You have to solve the missions everywhere and get out of there by the next morning through the game!! \n\nThrough constant running and tense confrontation, the hidden back of Korean landmarks will be revealed!', '/g6oocQwTsvXN0OaYFYrwvHwqVEp.jpg', 1, 7.9, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
