(49179, 37854, NULL, 'Long Ring Long Land', 'The Straw Hats accidentally float down into the Marine base, G-8. Forced to abandon ship, the crew must make their way through the base to reclaim the Going Merry and avoid capture.\n\nThe crew manage to safely reach their next island, Long Ring Long Land. They meet a nomad who\'s been stuck on the island for a while and offer to help him. But before they can, they\'re challenged by a pirate who calls himself Foxy the Silver Fox in a game of \"Davy Back Fight\", where the losers can lose their crew me', '/A2msjyMOBEdbSHjiPHWLZhKI5HS.jpg', 7, 8.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49180, 37854, NULL, 'Enies Lobby', 'The Straw Hats, Sogeking, the Franky Family, and the shipwrights of the Galley-La Company arrive at Enies Lobby aboard the Rocketman to rescue Nico Robin and Franky. Standing in their way, however, are the forces of the World Government, including its deadly assassination unit, CP9. A massive battle ensues between the two sides when Luffy declares war against the World Government.', '/7y6yoAIepNVrNTLMxgHEEgjEEge.jpg', 9, 8.5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49181, 37854, NULL, 'Thriller Bark', 'During their journey through the Florian Triangle, the Straw Hats arrive on a seemingly haunted island called Thriller Bark, where they encounter the Warlord Gecko Moria. Using his Devil Fruit abilities, Moria steals the Straw Hats\' shadows. With the help of a mysterious talking skeleton named Brook, the crew must regain their shadows before sunrise in order to survive.', '/gCWPlCfElGdGtl6xryoyXcadNd9.jpg', 10, 8.5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49182, 37854, NULL, 'Amazon Lily', 'After his defeat at the hands of Kuma at the Sabaody Archipelago, Luffy is sent flying and crash lands on Amazon Lily, an island exclusive to women that executes males on sight. As he tries to find a way off the island and back to his crew, Luffy makes unexpected friends and foes, while also learning of his brother\'s imminent peril.', '/bVjlWX17j9t6XB3AZ3KOv7ya7g7.jpg', 12, 8.7, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49183, 37854, NULL, 'Alabasta', 'The Straw Hats, with Kureha\'s assistant Tony Tony Chopper, finally arrive at Arabasta, which is on the verge of civil war. Vivi must reach the rebels and tell them the real cause behind the conflict, but Crocodile, leader of Baroque Works and one of the Seven Warlords of the Sea, will not just stand by and watch. In the end, Baroque Works, marine forces, pirates, the royal guards, and the rebel army clash in a battle that will determine the fate of the country itself.', '/psjQVMfKxjkiyH9fK9Byo9ynVy9.jpg', 4, 8.9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49184, 37854, NULL, 'Post-Alabasta, Goat Island & Ruluka Island', 'While on the run from some Marines, the crew stumble upon an island inhabited by a man named Zenny who lives with a herd of goats. The crew set out to him in his seemingly final days. After evading some Marines, the crew stop off in a small town with a huge tower, which is also being oppressed by the Mayor whose overtaxing the citizens. But a bigger concern is a nearby mist that prevents anyone who enters it from leaving.', '/dJHWwdcNzsbBUAnXdNsrIAgkmiK.jpg', 5, 8.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49185, 37854, NULL, 'Skypiea', 'The Straw Hats arrive on the Sky Island Skypiea and learn of its connections to Jaya and Mont Blanc Noland\'s tale of a lost city of gold. As the crew embarks in search of treasure, they become entangled in a three-way war between the native Skypieans, the vengeful Shandians, and the land\'s cruel \"god\", Enel.', '/hYasiagbhomaEj0Vv1LMqewOuBE.jpg', 6, 8.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49186, 37854, NULL, 'Sabaody Archipelago', 'The Straw Hat Pirates arrive at the final island of the Grand Line\'s first half, Sabaody Archipelago. While searching for a means to pass under the Red Line into the New World, they come into conflict with a deadly slave trading ring that sells to the World Nobles. Luffy and Zoro are labelled as two of the Eleven Supernovas, rookies of significant bounties who have simultaneously arrived at the archipelago. A chain reaction of events engulfs the archipelago in chaos, and the Straw Hats are faced', '/kMvtZUg4jCZ4JzEqvOCjkiklQfF.jpg', 11, 9.3, '2025-01-13 21:13:50', '2025-01-13 21:13:50');
INSERT INTO `tv_seasons` (`tv_season_id`, `tv_series_id`, `air_date`, `name`, `overview`, `poster_path`, `season_number`, `vote_average`, `created_at`, `updated_at`) VALUES
(49187, 37854, NULL, 'Impel Down & Marineford', 'Luffy puts finding his crew on hold in favor of rescuing his brother Ace from the underwater prison Impel Down. With Boa Hancock\'s help, he manages to infiltrate the facility. However, fulfilling his objective and escaping the hellish prison might be easier said than done.\n\nHaving failed to reach Ace before he was transferred, Luffy and his companions escape from Impel Down and travel to Marineford, the base of Marine Headquarters. With the odds stacked high against him, the imminent threat of W', '/zcVNRh5sqdgSgoXm0Z2GlTxF6DN.jpg', 13, 9.1, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49188, 37854, '1999-10-20 00:00:00', 'East Blue', 'Monkey D. Luffy meets the Red Hair Pirates as a young boy living in East Blue, swearing becoming the next Pirate King. 10 years later, Luffy sets sail and experiences first adventures, recruiting the first members of the Straw Hat Pirates.', '/9hW62RDq5Dno8vLABXscddjEq9M.jpg', 1, 8.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49189, 37854, NULL, 'Whisky Peak & Little Garden', 'With a Log Pose now in hand, the Straw Hat Pirates are directed toward Whisky Peak, a town that welcomes pirates with open arms and treats them like celebrities. However, the townsfolk have a dark secret, and an even deeper mystery awaits.\n\nNow with Vivi in tow, the Straw Hat Pirates travel to the prehistoric island of Little Garden. There, they encounter two Giants, Dorry and Brogy, who have been dueling one another on the island for the past century. After befriending the giants, the crew are ', '/egsfvwuojnsNZRTrqLkWyw09p6f.jpg', 2, 8.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49190, 37854, NULL, 'Drum Island', 'After Nami falls ill with an unknown disease, the Straw Hat Pirates travel to Drum Island in search of a doctor. The crew meets a bizarre talking reindeer named Tony Tony Chopper, who helps them fend off the country\'s former despot king Wapol after he returns to reclaim his throne.', '/fyOt2eCAVAB5tUpf4oOrLqX1cYD.jpg', 3, 8.8, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49191, 37854, '1999-12-18 00:00:00', 'Specials', '', '/d3TJkAgh8JZXrlD9z8R0pUgwIsx.jpg', 0, 0, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49192, 37854, NULL, 'Water Seven', 'The Straw Hats arrive at the oceanic metropolis of Water 7 to find a shipwright who can repair the Going Merry, as well as potentially join their crew. They soon become targeted by the Franky Family, the city\'s underground gang, and become involved in a plot within the Galley-La Company. Between the disappearance of Robin and a schism that develops between Luffy and Usopp, the crew begins to fall apart.', '/ww1JO056uv4KhDSycDTLkNRveIg.jpg', 8, 8.5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49193, 37854, NULL, 'Fishman Island', 'The Straw Hat Pirates finally arrive at Fishman Island. There, the crew learn the history of Fisher Tiger and the ongoing discrimination between humans and fishman, while the New Fishman Pirates plot to overtake Ryugu Kingdom and make fishman be recognized as the supreme race.', '/wpVC1e0RVK2qRtZMFDYu1c6mHcy.jpg', 14, 9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49194, 37854, NULL, 'Punk Hazard', 'Upon finally entering the New World, the Straw Hat Pirates immediately receive a distress call from residents of Punk Hazard, who state that a samurai is attacking them. Without hesitation, Luffy sets out to the blazing island, with Vice Admiral Smoker hot on his tail. On the supposedly death-ridden and empty island, the Straw Hats soon must contend with both the G-5 Marines, led by Vice Admiral Smoker, and the mad scientist Caesar Clown, whose deadly experiments must be stopped.', '/slTtfpqvqelTNoRTxTuiSvqWoTU.jpg', 15, 9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(49195, 37854, NULL, 'Dressrosa', 'The Straw Hat Pirates and Trafalgar Law, together with Kin\'emon, Momonosuke and the captured Caesar Clown, travel to Dressrosa with the goal of taking down the nation\'s king, Warlord of the Sea Donquixote Doflamingo. However, they soon set into motion a series of world-changing events, as their actions interact unexpectedly with those of larger forces at play.', '/sDzpqSCuCyvKIcJADOhPD261maG.jpg', 16, 9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
