(54651, 46392, '2002-10-21 00:00:00', 'Duel Masters', 'The world of Duel Masters is one of five great civilizations. Through a card game, duelists can bring these worlds into existence, making what was previously abstract into reality. These skilled duelists are known as Kaijudo masters.\n\nShobu Kirifuda is the best player at his local playground, and seeks to become a world-class master like his father. His first step on the road to conquest begins with winning a local tournament. Rather, it should have, except he is destroyed by the best Kaijudo ma', '/9geJLGR0xCU3tDPBNlGmyCB0fpK.jpg', 1, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(54652, 46392, '2007-04-09 00:00:00', 'Zero Duel Masters', 'It is featured in an alternate universe where Shobu had lost his duel against Hakuoh in their duel back in the Season 1 episode \"Just Duel It\".\n\nA mysterious organization is interested in fledgling duelist Shobu Kirifuda\'s ability to bring Duel Master creatures to life. With the support of his friends, Shobu duels with passion, discipline, and heart as he strives to be like his father and become the next Kaijudo master.', '/jM6iKubxAqofjK6MMPOCtDpkj4X.jpg', 3, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(54653, 46392, '2004-04-19 00:00:00', 'Duel Masters Charge', 'Shobu has returned after his 3 years training with all his friends in Battle Arena tournament. However, Shobu encounters a new enemy Zakira and his followers, the Fua Duelists. Zakira is a strong kaijudo duelist like Hakuoh. After kidnapping Hakuoh, they turn him into an enemy! Shobu and his friends try to stop them, but will they make it in time? Or will Shobu lose everything and end up devastated!?', '/igfp3mmrAahoxoSd29Y1Vjps0Ox.jpg', 2, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
