(59653, 1433, '2009-09-27 00:00:00', 'Season 6', 'Trigger-happy CIA operative Stan Smith will stop at nothing to defend everything that makes this country great – from strip bars to that most sacred of American institutions, crack cocaine! Whether he\'s trading brains with a racehorse or rescuing Roger from bloodthirsty revolutionaries, Stan will do whatever it takes to secure the blessings of liberty in this over-the-top salute to the greatest nation on Earth.', '/fP0VAvKgA2OUSdPW17NfaUvXbdP.jpg', 6, 7, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(59715, 42705, '2013-10-06 00:00:00', 'Rising', 'Hajime no Ippo: Rising continues Ippo\'s quest to become stronger, featuring the same cast of loveable dimwits from Kamogawa Gym, as they put their bodies and hearts on the line to make their way in the harsh world of professional boxing. With a will of iron, Ippo steps into the ring once again.', '/vvj28BXa350Ft7DArhKKtk2yvhu.jpg', 3, 10, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(59772, 291, '1960-12-08 00:00:00', 'Season 1', '1960', NULL, 1, 2, '2025-01-13 21:13:47', '2025-01-13 21:13:47'),
(59776, 13916, '2006-10-04 00:00:00', 'Season 1', 'An intelligent high school student goes on a secret crusade to eliminate criminals from the world after discovering a notebook capable of killing anyone whose name is written into it.', '/1BloDOEmKxPFzbCIuNCLmCrcx6L.jpg', 1, 7.8, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(59903, 60572, '2002-11-21 00:00:00', 'Advanced', 'Polishing off the Silver Conference, Ash heads toward his next challenge—the far-off Hoenn region! While he must say goodbye to old friends, he makes the acquaintance of May, a Trainer just starting out on her Pokémon journey. Along with her little brother Max and the ever-reliable Brock, this pack of Pokémon Trainers begin pursuing their dreams—with Ash racking up three Gym Badges, while May changes tack to follow the Contest path of a Pokémon Coordinator.', '/1dNnm3ghzcnxM9M80NnBnDGmnZI.jpg', 6, 5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(59904, 60572, '2001-08-09 00:00:00', 'Master Quest', 'With the Olivine City Gym temporarily out of commission, our heroes are off to the Whirl Cup Competition—and Misty wants in on the action! Resuming their journey, they find that Jessie, James, and Meowth aren’t the only members of Team Rocket they need to worry about, though that dastardly trio still has a few tricks up their collective sleeve. After a heated battle with the final Gym Leader, Ash moves on to the Silver Conference, but does he have the mettle to take on his old rival, Gary?', '/3zE4sEZLUxZjJmaszTdmSiE8MXe.jpg', 5, 5.8, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(59906, 60572, '1999-10-14 00:00:00', 'The Johto Journeys', 'Upon returning to Pallet Town, Ash and Misty reunite with Brock and set out on the next stage of their Pokémon journey—the Johto region! Though he still has an errand to run for Professor Oak, Ash jumps with both feet into the Johto League, taking on a couple of Gym Leaders and adding Pokémon like Totodile and Chikorita to his team.', '/n5lhMLbT3FQtI6EUN84bEHZPfsm.jpg', 3, 5.8, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60059, 60625, '2013-12-02 00:00:00', 'Season 1', 'Rick and Morty visit a pawn shop in space, encounter various alternate and virtual realities, and meet the devil at his antique shop.', '/h9RUEsA6BROWcg0QF6ngNPX5FFh.jpg', 1, 8, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60223, 60059, '2015-02-07 00:00:00', 'Season 1', 'Jimmy McGill was a small-time lawyer, hustling to make ends meet. This is how the search for his destiny and the story of Saul Goodman collide.', '/bAbZBZmz25Lqk8A8mwMWzAkvlAj.jpg', 1, 8.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
