(60744, 60572, '1997-04-01 00:00:00', 'Indigo League', 'It’s Ash Ketchum’s tenth birthday, and he’s ready to do what many 10-year-olds in the Kanto region set out to do—become a Pokémon Trainer! Things don’t go exactly the way he planned when he ends up with a Pikachu instead of a standard first Pokémon, and winning Gym Badges turns out to be much tougher than he thought. Luckily he’s got former Gym Leaders Brock and Misty at his side, along with a bevy of new Pokémon friends, including Bulbasaur, Squirtle, and Charmander.', '/f14a75WxUcKBu7nPBQjyJufIFuC.jpg', 1, 6.9, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60745, 60572, '1999-01-28 00:00:00', 'Adventures in the Orange Islands', 'With his Kanto journey completed, Ash finds there’s still plenty to see and do when Professor Oak sends him and his friends to the Orange Islands. Brock falls head-over-heels for the attractive Professor Ivy and decides to stay with her, leaving Ash and Misty alone as a dynamic duo—at least until they meet intrepid Pokémon watcher Tracey Sketchit!', '/jvPiZgn081n1yfb1Stm54dS5bB6.jpg', 2, 6.7, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60746, 60572, '2000-08-03 00:00:00', 'Johto League Champions', 'From the sprawling metropolis of Goldenrod City to the icy peak of Snowtop Mountain, the Johto region presents Ash, Misty, and Brock with exciting new adventures—along with a few familiar faces like their old friends Todd, Duplica, and Suzie! Johto’s rich past means plenty of Pokémon mysteries for our heroes to solve, and its exciting present means some tough challenges—Ash tackles three more Gyms, while handling competitions like the Pokémon Sumo Conference along the way.', '/nAMEzgCCrBDlZOV6iuggOWQbzSk.jpg', 4, 5.7, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60747, 60572, '2003-09-04 00:00:00', 'Advanced Challenge', 'A shadow hovers over Ash, May, and friends as they continue their journey through the Hoenn region, and it’s not just that of Mt. Chimney—both Team Magma and Team Aqua put plans into action with our heroes caught in the middle! When not foiling evil schemes, Ash and May chase their personal goals, with Ash battling for three more Gym Badges and May winning her first three Contest Ribbons. The group also gains new Pokémon like Torkoal and Bulbasaur, but could they be too much to handle?', '/wFYVZSGRgUxjvACnEdlOwEmAUoE.jpg', 7, 5.1, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60748, 60572, '2004-09-09 00:00:00', 'Advanced Battle', 'Ash earns his final two Badges and secures himself a spot in the Hoenn League Championships, while May comes dangerously close to not getting her final Ribbon—setting the stage for epic showdowns with both of her rivals in the Grand Festival. Ash meets two Trainers that become his own Hoenn rivals, facing off against both of them during the course of the tournament. Upon returning to Kanto and reuniting with old friends, Ash is recruited for a new challenge—the Battle Frontier!', '/14xmF5WNaKkqp33a6THM4e148aV.jpg', 8, 5.2, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60749, 60572, '2005-10-06 00:00:00', 'Battle Frontier', 'The territory might be familiar, but even Ash and Brock can find more than a few surprises in their home region of Kanto, like a Pokémon Ranger hot on the cases of two Legendary Pokémon! May’s back on the Contest path, blazing a trail to the Kanto Grand Festival, while Ash seeks out the hidden facilities of the Battle Frontier. If finding them wasn’t hard enough, he’s still got battles with the Frontier Brains to deal with—much tougher than any Gym Leader he’s ever faced.', '/hWVTDLo2KRvkD9b4wCeDtUdevEW.jpg', 9, 5.3, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60750, 60572, '2006-09-28 00:00:00', 'Diamond and Pearl', 'If Gary Oak is headed for the Sinnoh region, then Ash Ketchum won’t be far behind! Ready to take on the Sinnoh League, Ash brings along Pikachu and meets up with Brock in Sinnoh, where the pair of Trainers are soon joined by a third—Dawn, a novice Pokémon Coordinator determined to follow in the footsteps of her mother. Both Ash and Dawn struggle with their respective paths, but it’s easy for them to make new friends, gaining new Pokémon like Turtwig and Piplup.', '/hwRJwucYman0LnOPxpumq3uXmbP.jpg', 10, 5.1, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60751, 60572, '2007-11-08 00:00:00', 'Diamond and Pearl: Battle Dimension', 'It’s looking good for Ash as he works on his next three Gym Badges, but not so good for Dawn, coming off a pair of Contest defeats. Both will do what they can to become better Trainers, from entering the Wallace Cup competition to attending Professor Rowan’s Pokémon Summer Academy. Hopefully, the new tactics they pick up will give them the tools they need to succeed against the latest plot by Pokémon Hunter J—as well as the emerging threat of Team Galactic!', '/yy4fv3j4BqoLvyLl5ZuNEOSWhSy.jpg', 11, 5.2, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60752, 60572, '2008-12-04 00:00:00', 'Diamond and Pearl: Galactic Battles', 'As the menace of Team Galactic continues to loom over the Sinnoh region, Ash and Dawn keep getting caught up in the schemes of this mysterious group of villains—as well as facing some other unexpected challenges! Dawn’s got her hands full dealing with the many problems of her Pokémon, while Ash’s ongoing rivalry with Paul finally comes to a head in a full 6-on-6 battle! It might be the ultimate test of training styles—will our heroes come out on top?', '/d4HfiaIXNsrdGrSALYA1G3uUIZR.jpg', 12, 5.5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60753, 60572, '2010-01-07 00:00:00', 'Diamond and Pearl: Sinnoh League Victors', 'Watch Ash, Dawn, and Brock travel across the Sinnoh region to face challenges, battles, and the antics of Team Rocket! With Team Galactic out of the way, Ash can now focus on qualifying for the Sinnoh League. And Dawn will train to compete for her final Contest Ribbon, which would allow her to compete in the Grand Festival!', '/m2C9bUwL9Qj7uA3pRWvVJC0e6fs.jpg', 13, 5.6, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60754, 60572, '2010-09-23 00:00:00', 'Black & White', 'When Ash and his mother accompany Professor Oak to the distant Unova region, Ash discovers Pokémon that he’s never seen before… and that he can’t wait to catch! He may have Pikachu at his side together with new friends Iris and Cilan, but he’ll still need plenty of new Pokémon on his team if he wants to challenge Unova’s expert Gym Leaders. His quest to become a Pokémon Master just got even tougher!', '/iJ8XRK2OBuanoOyrtZ03BsuBAsA.jpg', 14, 4.5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60755, 60572, '2011-09-22 00:00:00', 'Black & White: Rival Destinies', 'As Ash and his friends continue to explore the Unova region, he’ll find himself up against the ultimate battle challenge: Alder, the Champion Master of Unova! His friends also face their own trials, one fighting for the right to continue her travels, another confronting a returning challenge from the past—and all three of them must team up to save an island from the clashing forces of three powerful and mysterious Legendary Pokémon!', '/iwwve5hgNYkyyfaFbqBrpaOrxD6.jpg', 15, 4.5, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60756, 60572, '2012-10-11 00:00:00', 'Black & White: Adventures in Unova', 'Ash and his friends Iris and Cilan have foiled Team Rocket’s latest evil plan, but a new danger lurks on the horizon! But first, with eight Gym badges in hand, Ash is ready to take on the region’s ultimate challenge: the Unova League, where he’ll face familiar rivals and new opponents in his ongoing quest to become a Pokémon Master! Meanwhile, Iris has been having some trouble connecting with her powerful and stubborn Dragonite—can a visit home to the Village of Dragons help sort things out for ', '/bv9PugS3yIDIScxUR8Ye2DyrpM0.jpg', 16, 4.4, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60757, 60572, '2013-10-17 00:00:00', 'XY', 'It’s time for Ash and Pikachu to set off on their adventures in the Kalos region! Along the way, they’re joined by some new friends—a genius inventor named Clemont, his little sister Bonnie, and Serena, a Trainer on her first journey. Ash immediately tries to challenge the Gym in Lumiose City, but doesn’t get very far before a robot throws him out! In between Gym battles, Ash and friends will be exploring this unique region, meeting all kinds of new Pokémon, and looking into a fascinating new Po', '/rLGQTEL8bcrZEkl30S3Z9uoca4u.jpg', 17, 6.8, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(60937, 60863, '2014-04-06 00:00:00', 'Season 1', 'Two boys who were bitter volleyball rivals in middle school join forces on their high school team to take on other schools with a vengeance.', '/1Rfa9o5H6ZlXzbDVNlw4jULdXpi.jpg', 1, 8.5, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
