(63174, 1433, '2014-10-20 00:00:00', 'Season 12', 'Get ready for full-scale hilarity and huge laughs with this all-new collection of American Dad! episodes from the comically oversized minds of Mike Barker, Matt Weitzman and Family Guy Creator Seth MacFarlane. Bulging with celebrity guest voices, including Kristin Chenoweth, Ted Danson, Kim Kardashian, Dean Norris, Mickey Rooney and Uma Thurman, this outrageous assortment finds Stan miniaturized after seeing a shrink, Steve embraces his inner lesbian, Roger crushing on a crash-landed alien , and', '/qSDCs2wrJExR3Bu8ZN46YFooOiF.jpg', 12, 7, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
