(66979, 62741, '2012-10-02 00:00:00', 'Season 1', 'High schooler Nanami has quite a few problems of late, beginning with her absentee father being in such extreme debt that they lose everything. Downtrodden and homeless, she runs into a man being harassed by a dog. After helping him, she explains her situation, and to her surprise, he offers her his home in gratitude. But when she discovers that said home is a rundown shrine, she tries to leave; however, she is caught by two shrine spirits and a fox familiar named Tomoe. They mistake her for the', '/6SYc4QlshFxAYsK33njymMUBfJD.jpg', 1, 8.8, '2025-01-13 21:13:51', '2025-01-13 21:13:51');
