(90191, 46392, '2007-10-06 00:00:00', 'Duel Masters Zero', 'The previous season of \'Zero Duel Masters\' was set in an alternate universe, so this season\'s plot is a continuation of the Duel Masters Charge.\n\nIt follows the aftermath of the duel of Shobu vs Zakira.', '/dcUcMEpMCZj8El7kZUoDDLOcmV2.jpg', 4, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(90192, 46392, '2008-04-05 00:00:00', 'Duel Masters Cross', 'Shobu and friends fight the remaining Fua Duelists in order to defeat Zakira. Once again, they face off against the old members of Fua Duelists at the World Championship tournament.\n\nShobu also found the terrible fate his friends faced because of these duelists in their past.', '/p5WQbwz02JKqpxIoLMxSt5BlR6p.jpg', 5, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
