(90196, 46392, '2011-04-02 00:00:00', 'Duel Masters Victory', 'As shown in Episode 32 of Duel Masters Versus, this storyline follows the events of the Duel Masters: Star Cross manga instead of Cross Shock.\n\nIt introduces a new protagonist named Katta Kirifuda, the brother of Shobu.\n\nHe wants to be a dueling champion like his brother Shobu, but in his own way. The series shows the beginning of his dueling adventures with his friends, Bucyake, Yohdel and Benchan. During these adventures he considers Dragon Ryu a fierce duelist as his rival.\n\nThis series also ', '/bHzHn1Un3mz3hfzOBL43WhoEkBg.jpg', 7, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(90197, 46392, '2012-04-07 00:00:00', 'Duel Masters Victory V', 'This series continues the adventures of Katta Kirifuda, Bucyake and Yohdel throughout the school season. They meet new classmates such as Leo to duel against.', '/wMLuEAS5187HbzgsqFxoR61Coxh.jpg', 8, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(90199, 46392, '2013-04-06 00:00:00', 'Duel Masters Victory V3', 'In this series the story continues after Katta Kirifuda defeats the YA.RA.SI band and also gains back his popularity by defeating Leo and his sidekick Nai Minamimo.\n\nKatta will use a new race of Outrage creatures against the opposing new race of Oracle deck users. Also in the creature world a new time era will start off.', '/e5ReUfhpEox1JbEHqUmMRomTeto.jpg', 9, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(90210, 46392, '2014-04-05 00:00:00', 'Duel Masters VS', 'The most anticipated card game, Duel Masters had returned after 2 years since the battle in the past season. However, Katta Kirifuda once the strongest duelist, is now a year 2 middle school student and had lost his passion of dueling throughout the 2 years, and dreams of curry bread every day.\n\nHowever, after an encounter with the baseball ace, Hokaben, a mysterious duelist and a reunion with his childhood friend Lulu Takigawa, he rekindled his dueling spirit and return to his journey of becomi', '/pppjkkUKF2p2kicLGcmAAbKwLhr.jpg', 10, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
(90213, 46392, '2015-04-05 00:00:00', 'Duel Masters VSR', 'A next fierce fight is about to begin after Katta Kirifuda finally become the Duel Masters National Tournament champion.\n\nJapan\'s largest theme park, Duel Masters Land has appeared. With numerous fun attractions and events, Katta was also having fun. However, after meeting the mascot of the park, \"Duemouse\", Katta got involved in a ridiculous conspiracy of the park.\n\nA shadow that invades the Duel Masters World, which is the mysterious team of duelists! The mysterious identity of the legendary c', '/70tygdMZu9N1y7W0AzexztAnzui.jpg', 11, 0, '2025-01-13 21:13:49', '2025-01-13 21:13:49'),
