(131698, 911, '2010-10-11 00:00:00', 'Season 4', 'During this season, Much like other countries\' version of the game, the clock stops whenever a lifeline is used and if the time limit expired, the contestant was forced to walk away with their current winnings. This season introduced the \"Double Dip\" and \"Ask the Expert\" lifelines (similar to the United States counterpart from the Millionaire clock format).', NULL, 4, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(131699, 911, '2011-08-15 00:00:00', 'Season 5', 'This season introduced a play at home segment called \"Ghar Baithe Jeeto Jackpot\". This contest allowed home viewers to send an answer to a question via SMS during the show, with 1 Lakh Rupees going to the randomly picked winner, who can double or triple this amount by correctly answering further questions.', NULL, 5, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
(131700, 911, '2012-09-07 00:00:00', 'Season 6', 'This season, KBC started a new tradition of giving an advantage to socially excluded people, known as \"Dusra Mauka\". Sonali Mukherjee, a victim of acid throwing, appeared along Lara Dutta in the first such special. On 13 January 2013, another special aired in which Manoj Kumar, a Mahadalit was accompanied by Indian actor Manoj Bajpayee. The winner of season 6 was Sunmeet Kaur.', NULL, 6, 0, '2025-01-13 21:13:48', '2025-01-13 21:13:48'),
