(135504, 95269, '2020-01-10 00:00:00', 'Season 1', 'Kamome Academy is rumored to have many mysteries, the strangest of which involves the mischievous ghost of Hanako-kun. When occult-loving high schooler Nene Yashiro accidentally becomes bonded to him, she uncovers a hidden world of supernatural beings. Now the two of them are conspiring to keep the peace between student and supernatural—that is, if they can only stay out of trouble themselves.', '/iehq6tSUylg5kFkOxndNYZWjzNu.jpg', 1, 9.4, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
(136012, 291, '2019-01-01 00:00:00', 'Season 60', '', NULL, 60, 0, '2025-01-13 21:13:47', '2025-01-13 21:13:47'),
(136016, 60572, '2019-11-17 00:00:00', 'Journeys', 'Pokémon Trainer Ash Ketchum has a new plan: see the world! But first, he and his partner Pikachu are headed to the opening of the Cerise Laboratory, a research facility dedicated to uncovering the mysteries of Pokémon in every region. Ash meets Goh, another boy with boundless curiosity about Pokémon, and both are overjoyed when Professor Cerise asks them to become official research fellows. With Ash as determined as ever to become a Pokémon Master, and Goh aiming to catch one of every Pokémon (i', '/4oTX1UCgKlMjaWY8KIdkhXZQiSA.jpg', 23, 5.2, '2025-01-13 21:13:50', '2025-01-13 21:13:50'),
(136020, 95557, '2021-03-23 00:00:00', 'Season 1', 'Nolan Grayson (Omni-Man) is unquestionably the strongest being on our planet; he is also our most spirited protector, having saved the planet from untold calamity. His son Mark, wants nothing more than to follow in his footsteps. But there\'s something sinister afoot and Omni-man may not be what he appears. Which may prove even too much for the Guardians of the Globe.', '/yDWJYRAwMNKbIYT8ZB33qy84uzO.jpg', 1, 8, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
