(243774, 85937, '2023-04-08 00:00:00', 'Swordsmith Village', 'For centuries, the Demon Slayer Corps has sacredly kept the location of Swordsmith Village a secret. As the village of the greatest forgers, it provides Demon Slayers with the finest weapons, which allow them to fight night-crawling fiends and ensure the safety of humans. After his sword was chipped and deemed useless, Tanjiro Kamado, along with his precious little sister Nezuko, is escorted to the village to receive a new one.\n\nMeanwhile, the death of an Upper Rank Demon disturbs the idle order', '/6gD7G8HQay1X8mHiFVttWJ3czYb.jpg', 4, 6.3, '2025-01-13 21:13:51', '2025-01-13 21:13:51'),
