(100, 0, '/cJKGfZHkMFtbVA4m2kwmdGk8uHp.jpg', '2004-05-10 00:00:00', 'https://www.bbc.co.uk/programmes/p011fgk5', 0, '2004-10-19 00:00:00', 'I Am Not an Animal', 4694, NULL, 'GB', 'en', 'I Am Not an Animal', 'I Am Not An Animal is an animated comedy series about the only six talking animals in the world, whose cosseted existence in a vivisection unit is turned upside down when they are liberated by animal rights activists.', '/qG59J1Q7rpBc1dvku4azbzcqo8h.jpg', 'Ended', 23, 8.6, 780, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(246, 0, '/cJdnkIrD9vcIUiCbWjay55qoaQz.jpg', '2005-02-21 00:00:00', 'https://www.nick.com/shows/avatar-the-last-airbender', 0, '2008-07-19 00:00:00', 'Avatar: The Last Airbender', 13575, NULL, 'US', 'en', 'Avatar: The Last Airbender', 'In a war-torn world of elemental magic, a young boy reawakens to undertake a dangerous mystic quest to fulfill his destiny as the Avatar, and bring peace to the world.', '/9RQhVb3r3mCMqYVhLoCu4EvuipP.jpg', 'Ended', 88, 8.735, 4189, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
