(243512, 0, '/hmNgVtGWKYWQg6C6dAdRaASgt1M.jpg', '2025-01-02 00:00:00', 'https://v.youku.com/v_show/id_XNjQ0NjE1ODkzNg==.html', 1, '2025-01-11 00:00:00', 'The Blossoming Love', 5325821, NULL, 'CN', 'zh', '千朵桃花一世开', 'In ancient times, the Human Emperor, Zhao Ming, petitioned on behalf of the people and sacrificed himself to resist the divine realm. After Zhao Ming\'s fall, his beloved, Hun Dunzhu, risked her life to save a wisp of his soul, setting up the cycle of reincarnation for eternity. In the distant future, Zhao Ming reincarnated as Xie Xuechen, the leader of the Immortal Alliance, while Hun Dunzhu became the Holy Maiden Mu Xuanling in the Dark Domain. The two finally reunited in the mortal realm but h', '/lAFxsacfM8r4XMh6ZeP48l1gCRS.jpg', 'Returning Series', 1052, 8.3, 3, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(247885, 0, '/tCKEZIJJcZHhGyROj7Wdsuf7Vhl.jpg', '2024-10-21 00:00:00', 'https://www.lasestrellas.tv/telenovelas/papas-por-conveniencia', 1, '2025-01-10 00:00:00', 'Papás por conveniencia', 5774509, 5774511, 'MX', 'es', 'Papás por conveniencia', 'Tino, a single father who faces great challenges in raising his two children, finds out one day that he is also the father of two rebellious teenagers, children of Aidé, a former high school classmate who has become an important businesswoman. For Tino, this news becomes an opportunity to take on the role of father of the children he never knew he had. Thus, he begins to work at Aidé\'s company, but everything gets complicated when Tino and his family move into Aidé\'s house to integrate into her ', '/y7yIu9PKx2WTphhYgbBq9C1RNzV.jpg', 'Returning Series', 886, 7.667, 39, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(248890, 0, '/mLcD1v4sfoa1juOsBat7Vik7wEe.jpg', '2024-03-18 00:00:00', '', 1, '2025-01-10 00:00:00', 'Ready Steady Cook South Africa', 5209246, 5209247, 'ZA', 'en', 'Ready Steady Cook South Africa', 'In Ready Steady Cook, two teams - a Red Tomato and a Green Pepper - compete in a Red Kitchen and a Green Kitchen, together with a South African chef on each side and paired with enthusiastic home cooks, as they are challenged creatively with a mystery bag of ingredients in a 20-minute cook-off.', '/30xX4IMbgnMbQwo76xM4BOSokZO.jpg', 'Returning Series', 842, 4.5, 9, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(249010, 0, '/4i3iJepkqqH5JJgTNLJdi8ke6ir.jpg', '2024-05-06 00:00:00', 'https://www.etv.co.za/scoop/kelders-van-geheime-0', 1, '2024-12-31 00:00:00', 'Kelders van Geheime', 5843634, 5843635, 'ZA', 'af', 'Kelders van Geheime', 'Kelders van Geheime (Cellars of Secrets) is a South African, Afrikaans-language telenovela based on the wheeling\'s and dealings of the community that lives on Soebatskloof (a wine farm in the Cape). The series focuses on three families: the Abrahams, Syster and Marais households. These families will have to stand together, agree (or agree to disagree), and work together to earn their bread and butter – and a glass of wine.', '/vf1I0G5jICTstI1EXxb9Oqq80TU.jpg', 'Returning Series', 1030, 6, 13, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(251691, 0, '/2wNuLc0cEoPz6PZItftrZLHjG2k.jpg', '2024-10-27 00:00:00', 'https://shahid.mbc.net/ar/series/%D8%AE%D8%B1%D9%8A%D9%81-%D8%A7%D9%84%D9%82%D9%84%D8%A8-%D8%A7%D9%8', 1, '2025-01-06 00:00:00', 'Autumn of the Heart', 5675034, 5675035, 'SA', 'ar', 'خريف القلب', 'A devastating car accident unearths a long-buried secret that turns wealthy businessman Rashid and hardworking Nahla\'s life around; fifteen years ago, their daughters were switched at birth.', '/8uDmIxjBx90y5OCwJDBADtQzxb7.jpg', 'Returning Series', 2241, 4, 10, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(256121, 0, '/zk3UqXnnK7cpUv6LsD9DS8FtUxb.jpg', '2024-09-02 00:00:00', 'https://www.iwanttfc.com/#!/open/lavenderfields', 1, '2025-01-10 00:00:00', 'Lavender Fields', 5564814, 5862435, 'PH', 'tl', 'Lavender Fields', 'The life of a simple flower farm girl is shattered when she falls for a charming accountant, who turns out to be a married gun cartel member. Targeted for his stolen money, she loses everything she holds dear and reinvents herself to seek justice.', '/7o9eY4qolqVn7SDLZzpJ89t7QYE.jpg', 'Returning Series', 1342, 7.2, 6, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
