(259666, 0, '/jmV6NIzZxGzRoljFPwao6sh4Nny.jpg', '2024-08-09 00:00:00', 'https://www.primevideo.com/detail/0NDOOURNT1AKGIM79ZEDTH4V2G', 0, '2024-08-09 00:00:00', 'No One Will Miss Us', 5522508, NULL, 'MX', 'es', 'Nadie nos va a extrañar', 'It\'s the \'90s, and five losers run an illegal business at their high school. They sell homework and assignments to their classmates. The advantage is that no one ever suspects the nerds. Their business brings them money and popularity. But hormones and an unexpected death threaten to ruin everything. If the business collapses, their futures and their friendships are at risk.', '/py0s87C9214KRbZ4kWLQfgsE9ET.jpg', 'Ended', 63, 8.7, 202, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(261121, 0, '/s41aHDgGza66JSwEc0poXSuBrmx.jpg', '2024-11-18 00:00:00', '', 1, '2025-01-08 00:00:00', 'Desperate Mrs. Seonju', 5798493, 5798494, 'KR', 'ko', '친절한 선주씨', 'Pi Seon Ju works as an interior designer in a small neighborhood. She is married to Jeon Nam Jin, who is an ambitious architect. Although Pi Seon Ju is devoted to her husband, her husband falls in love with Jin Sang A, who will become the successor of an architecture company. To further pursue his love and ambitions, Jeon Nam Jin demands a divorce from Pi Seon Ju. After their divorce, Pi Seon Ju decides to start her new life.\n\nMeanwhile, architect Kim So U is married to Jin Sang A. Unlike Jin Sa', '/wALnisqW9vGGJWH1GYUeCCWTcYd.jpg', 'Returning Series', 1158, 6.3, 3, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(262831, 0, '/ueQ3OVzCjBS7dgOEgunELfPfRbC.jpg', '2024-10-07 00:00:00', 'https://program.kbs.co.kr/1tv/drama/mymerrymarriage/pc/index.html', 1, '2025-01-10 00:00:00', 'My Merry Marriage', 5796163, 5796164, 'KR', 'ko', '결혼하자 맹꽁아!', 'A delightful family drama that asks the true meaning of \'happiness\' by showing various aspects of marriage such as divorce, remarriage, and single life, and brings about empathy and laughter from all generations.\n\nMaeng Gong Hee is a contract designer at Jayce Fashion. Having inherited her strong mother\'s spirit and her former detective father\'s athletic ability, she is a rare wild woman these days who has the guts to survive even if she were to be stranded on a deserted island.\n\nGu Dan Soo is t', '/lp7uJ6tZ9k8m7kW75hIAOUafXr4.jpg', 'Returning Series', 1118, 9.5, 2, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(273042, 0, '/9lN6AgYnVvaSmYneCowp7RQtZFy.jpg', '2024-11-04 00:00:00', '', 1, '2025-01-07 00:00:00', 'Our Honorary Photo Studio', 5767719, 5767720, 'TW', 'zh', '阿榮與阿玉', '', '/ziHUUJpuuVc9qtN9I95SWpBC3ni.jpg', 'Returning Series', 1012, 0, 0, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(273327, 0, '/vFJpFtQsYs6jY1CrAESGneVVI3o.jpg', '2024-11-11 00:00:00', 'https://shahid.mbc.net/ar/series/%D9%86%D9%82%D8%B7%D8%A9-%D8%B3%D9%88%D8%AF%D8%A9-%D8%A7%D9%84%D9%8', 1, '2025-01-12 00:00:00', 'Black Point', 5800005, 5800006, 'EG', 'ar', 'نقطة سودة', '“Black Point” takes place in a social romantic setting, exploring the complex relationships between its diverse characters.', '/xrGx7uRbCc9qwU76YD2wJXL56Js.jpg', 'Returning Series', 1414, 1, 1, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(273825, 0, '/jFIwFNfXBewO0quEGb0p3wvL3HP.jpg', '2024-11-04 00:00:00', '', 1, '2025-01-10 00:00:00', 'Amor amargo', 5879376, 5879377, 'US', 'es', 'Amor amargo', '', '/u8TkzDfknYHbx0NEsD8TSzw3M5f.jpg', 'Returning Series', 983, 7.5, 15, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(273911, 0, '/k47iw0yNjippeLxkUv7kjqwdyL9.jpg', '2024-10-08 00:00:00', '', 1, '2025-01-09 00:00:00', 'La mujer de mi vida', 5782426, 5784979, 'ES', 'es', 'LA MUJER DE MI VIDA', 'The series revolves around Ricardo Oribe (Iván Sánchez), a physically unattractive but successful businessman, dedicated to his family and in love with his beautiful wife Daniela (Angélica Celaya), a young aspiring actress. Ricardo\'s life takes a turn when his best friend Emilio (Mauricio Islas) betrays him and tries to kill him in order to take over his company and the family he never had. Despite being presumed dead by his family and friends, Ricardo is still alive, but suffering from amnesia.', '/4Qksv87C57O0IWA8sT2KwxZ4fXh.jpg', 'Returning Series', 993, 3, 1, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(275474, 0, '/yEamRf8CDfCAoYWhi6L5E4CWQab.jpg', '1992-05-02 00:00:00', 'https://www.rbb-online.de/brandenburgaktuell/', 1, '2020-01-01 00:00:00', 'rbb24 Brandenburg aktuell', 5788644, 5788645, 'DE', 'de', 'rbb24 Brandenburg aktuell', '', NULL, 'Returning Series', 1433, 6, 1, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(276465, 0, '/lntobwOaMkACftGIULcp6n4kqOF.jpg', '2012-06-11 00:00:00', 'https://www.tmz.com/watch/tmz-live/', 1, '2025-01-09 00:00:00', 'TMZ Live', 5747673, 5747674, 'US', 'en', 'TMZ Live', 'This hourlong show is an edited version of the previous day\'s live video chat on TMZ, which features site founder Harvey Levin and others discussing the day\'s celebrity and entertainment news. Besides news, it provides a candid look at how the gossip site operates, bringing viewers into the site\'s newsroom, where the daily chats take place. \"TMZ Live\" allows viewers to present their opinions on the featured topics through social media, phone calls and video chat.', '/12sC6lRA7ds448jaoDUtj5qGSwh.jpg', 'Returning Series', 934, 2, 1, '2025-01-13 20:34:07', '2025-01-13 20:34:07'),
(280113, 0, NULL, '2024-12-24 00:00:00', 'https://v.qq.com/x/cover/mzc002003y2brei/n3574ul1rpt.html', 1, '2025-01-12 00:00:00', 'Good Luck', 5860579, NULL, 'CN', 'zh', '石来运转', 'Shi Lai, an ordinary man, connected to a mysterious stone, experiences three unique romantic encounters and a twist of fate that changes his life. As he faces challenges in the enigmatic town of Gu Mie, he must find a way to turn his life around and rise to the top.', '/eNpQLfB2MqIDOMlqUntLHNJjtrs.jpg', 'Returning Series', 703, 7, 1, '2025-01-13 20:34:07', '2025-01-13 20:34:07');
